deck_description:
This is a Toon deck that tries to protect your monsters using the new support and then attack directly to end the duel quickly. It has an Assault Mode engine to make powerful synchros to disrupt your opponent moves, you can swich this with the Halquifibrax combo if you want to.

&nbsp;

Gameplay:

I found out from YouTube that <em>Godzilla VS King Kong</em> is going to air in 2021, assuming nothing goes wrong. And for the past few weeks, if not months, I have been getting back into Godzilla; I used to be a big fan back in middle school. So I made this Dinosaur Kaiju deck, named "Godzilla March", after Godzilla's iconic theme song.

&nbsp;

Because of the Kaiju engine here, going second is more important than ever for Dinos. Interrupted Kaiju Slumber is one of the best cards in the deck, not just because it turns the tables if your opponent has multiple strong monsters on board, but because it works surprisingly well with Lost World. With Kaiju Slumber, you can give yourself a Dogoran and your opponent any other Kaiju, and Dogoran will be stronger, since the opponent's Kaiju is not a Dinosaur. Plus, you can do this before your Normal Summon so that your opponent will get a Juraegg Token and they can't target any non-tokens with card effects.

&nbsp;

Slumber also has synergy with Lost World because you can use it while the opponent has a Juraegg Token to pop a Babycerasaurus or Petiteranodon, and then search an Oviraptor. And one last thing about this deck? Because Animadorned Archosaur is Level 1, the Extra Deck has 2 Relinquished Anima in there. If you are able to summon it, then summon a Kaiju to your opponent's field in the zone Anima points to, so that Anima can equip it.

&nbsp;

As for the Side Deck, it contains 3 copies of cards that are all useful in the current meta. So if you're playing against a high-tier deck and it's time to get serious, just switch out the Kaiju cards for those.

&nbsp;

&nbsp;

This is mostly a theory craft deck that could be really effective if you change things around a little bit. I'm not a great deck builder, but I'm just here to create an idea that maybe some of you can take into consideration and make a good deck out of it. This deck has a focus of getting an OTK on your opponent, the Dogmatika stuff is there because it's also a LIGHT attribute deck that prefers going second. This is by no means a deck you should net deck. this is just a general idea of something I had last night when I was falling asleep.

&nbsp;

UPDATE: This new build is more playable as a standalone deck.

